// src/utils/avatars.js

import bitcoin   from '../assets/avatars/bitcoin.png';
import bnb       from '../assets/avatars/bnb.png';
import cardano   from '../assets/avatars/cardano.png';
import dogecoin  from '../assets/avatars/dogecoin.png';
import ethereum  from '../assets/avatars/ethereum.png';
import litecoin  from '../assets/avatars/litecoin.png';
import ripple    from '../assets/avatars/ripple.png';
import solana    from '../assets/avatars/solana.png';
import stellar   from '../assets/avatars/stellar.png';
import tether    from '../assets/avatars/tether.png';
import tron      from '../assets/avatars/tron.png';

export const avatarList = [
  { id: 'bitcoin',   image: bitcoin   },
  { id: 'bnb',       image: bnb       },
  { id: 'cardano',   image: cardano   },
  { id: 'dogecoin',  image: dogecoin  },
  { id: 'ethereum',  image: ethereum  },
  { id: 'litecoin',  image: litecoin  },
  { id: 'ripple',    image: ripple    },
  { id: 'solana',    image: solana    },
  { id: 'stellar',   image: stellar   },
  { id: 'tether',    image: tether    },
  { id: 'tron',      image: tron      },
];
